import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import Grid from '@material-ui/core/Grid';

const seriesStyles = makeStyles((theme) => ({
	card: {
		minWidth: 250
	}
}));

const dividerStyles = {
	backgroundColor: '#448ad4',
	margin: '5px 0',
	height: 1.5
};

const SeriesDetails = (props) => {
	const seriesClasses = seriesStyles();

	return (
		<Card className={seriesClasses.card}>
			<CardContent>
				<Typography variant='h6' component='h2'>
					{props.seriesDetails.name}
				</Typography>
				<Divider style={dividerStyles} />
				<Typography variant='body2' component='p'>
					This to show start and end date.
				</Typography>
			</CardContent>
		</Card>
	);
};

export default SeriesDetails;
